import React from 'react';
import { View, Text, Button, StyleSheet, StatusBar } from 'react-native';
import BottomTab from '../components/BottomTab';

const pendentDeliveries = [
  {
    id: 1,
    color: "blue",
    text: "text1"
  },
  {
    id: 2,
    color: "red",
    text: "text2"
  },
];

const HistoryScreen = () => {

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Pendent Deliveries</Text>
      {pendentDeliveries.map((prop, key) => {
        return (
          <Text style={{backgroundColor : prop.color}}>{prop.text}</Text>
        );
      })}
    </View>

  );
};


export default HistoryScreen;

const styles = StyleSheet.create({
  title: {
    fontSize: 32
  },
  container: {
      flex: 1,
      padding: 20,
      paddingTop: 20,
      paddingBottom: 20,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
  }
});
